INSERT INTO `car_comment` VALUES ('500', '5', '989', '284', '2', '怎么说呢，洗车后给我上传的照片是别人的车，早上不放心去看看到底洗了没有，结果不看不知道，看了才知道，说没洗，可能冤枉洗车小哥了。说洗干净了吧，我又不愿说谎话。', '0', '1443662326', '1443695061', '【“点趣”质量管理著】尊敬的用户您好。对于我们工作中的失误与对您造成的不便我们深表歉意。对此我们已经安排10月1日为您赠送1次免费车辆清洗。并确保清洁质量达到“点趣”的标准要求。感谢您选择点趣，更感谢你的支持与信任。');
