INSERT INTO `car_comment` VALUES ('567', '6', '1126', '205', '5', '洗车很及时，但是每次上传的照片都不是我们自己的车，是否是系统问题？', '0', '1444275009', '1444292524', '【“点趣”客服】亲，您好。点趣系统的确还有点漏洞，我们正在和微信沟通并全力修复。请谅解');
INSERT INTO `car_comment` VALUES ('568', '9', '1122', '320', '5', '还行 挺干净的', '0', '1444275954', '0', null);
INSERT INTO `car_feedback` VALUES ('5', '54', '0', '假冒骗子，8月7日下午7点左右，你们人员到我小区楼下地下停车场推广，我给他大妈10元现金，第二天我去车库，居然没给我洗，钱是小事，诚信堪忧！望答复！', '0', '1439001911', '1439891043', '赵先生 您好。公司为您的洗车账户里面充值了9.9元以享受一次免费洗车，而且后续还有更多的机会赠送哦。赶快预约试试吧。同时感谢赵先生您一直以来对“点趣”的支持与信任。');
INSERT INTO `car_feedback` VALUES ('6', '49', '0', '还不错。整得干净。继续努力。', '0', '1439450309', '0', null);
INSERT INTO `car_feedback` VALUES ('7', '180', '0', '麻烦帮我打蜡,蜡在后备箱', '1', '1441186457', '1441187466', '【“点趣”客服】亲，您好。已经安排人员为您打蜡，请放心。');
INSERT INTO `car_feedback` VALUES ('8', '223', '0', '你好，我付款多付了怎么办', '1', '1441719648', '1442216688', '亲，您好。您多付的款已经通过余额的方式打进您的个人点趣账户了。');
INSERT INTO `car_feedback` VALUES ('9', '98', '0', '李恒光测试意见反馈。20150909', '0', '1441805059', '0', null);
INSERT INTO `car_feedback` VALUES ('10', '265', '0', '不错', '0', '1442103053', '0', null);
